const SidebarIcon = ({
  icon,
  selected,
}: {
  icon: string;
  selected: boolean;
}) => {
  switch (icon) {
    case "home":
      return <HomeIcon selected={selected} />;
    case "schedule":
      return <ScheduleIcon selected={selected} />;
    case "map":
      return <MapIcon selected={selected} />;
    case "mentors":
      return <MentorsIcon selected={selected} />;
    case "sponsors":
      return <SponsorsIcon selected={selected} />;
    case "faq":
      return <FAQIcon selected={selected} />;
    default:
      return <HomeIcon selected={selected} />;
  }
};

export { SidebarIcon, Horsey };
